def bitstring_to_bytes(bitstr):
    # Ensure the length of the bit string is a multiple of 8 by padding with zeros
    while len(bitstr) % 8 != 0:
        bitstr.insert(0, 0)

    # Convert the bit string to bytes
    byte_array = bytearray()
    for i in range(0, len(bitstr), 8):
        byte = 0
        for bit in bitstr[i:i + 8]:
            byte = (byte << 1) | bit
        byte_array.append(byte)

    return bytes(byte_array)
